import React from 'react'
import InfoAbout from '../InfoAbout'
import { homeObjOne, homeObjThree, homeObTwo } from '../Data';
import Footer from '../Footer';


function About() {

  return (
    <>
    <div>
      <InfoAbout {...homeObjOne} />
      <InfoAbout {...homeObjThree} />
      <InfoAbout {...homeObTwo} />
      <Footer />

    </div>
    </>
  )
}

export default About
